    <script>
        //<script src="javascripts/Control.OSMGeocoder.js">
    if (typeof console == "undefined") {
        this.console = { log: function (msg) { /* do nothing since it would otherwise break IE */} };
    }


        L.Control.OSMGeocoder = L.Control.extend({
            options: {
                collapsed: true,
                position: 'topright',
                text: 'Locate',
                placeholder: '',
                bounds: null, // L.LatLngBounds
                email: null, // String
                callback: function (results) {
                    if (results.length == 0) {
                        console.log("ERROR: didn't find a result");
                        return;
                    }
                    var bbox = results[0].boundingbox,
                        first = new L.LatLng(bbox[0], bbox[2]),
                        second = new L.LatLng(bbox[1], bbox[3]),
                        bounds = new L.LatLngBounds([first, second]);
                    this._map.fitBounds(bounds);
                }
            },

            _callbackId: 0,

            initialize: function (options) {
                L.Util.setOptions(this, options);
            },

            onAdd: function (map) {
                this._map = map;

                var className = 'leaflet-control-geocoder',
                    container = this._container = L.DomUtil.create('div', className);

                L.DomEvent.disableClickPropagation(container);

                var form = this._form = L.DomUtil.create('form', className + '-form');

                var input = this._input = document.createElement('input');
                input.type = "text";
                input.placeholder = this.options.placeholder || '';

                var submit = document.createElement('input');
                submit.type = "submit";
                submit.value = this.options.text;

                form.appendChild(input);
                form.appendChild(submit);

                L.DomEvent.addListener(form, 'submit', this._geocode, this);

                if (this.options.collapsed) {
                    L.DomEvent.addListener(container, 'mouseover', this._expand, this);
                    L.DomEvent.addListener(container, 'mouseout', this._collapse, this);

                    var link = this._layersLink = L.DomUtil.create('a', className + '-toggle', container);
                    link.href = '#';
                    link.title = 'Nominatim Geocoder';

                    L.DomEvent.addListener(link, L.Browser.touch ? 'click' : 'focus', this._expand, this);

                    this._map.on('movestart', this._collapse, this);
                } else {
                    this._expand();
                }

                container.appendChild(form);

                return container;
            },

            /* helper functions for cordinate extraction */
            _createSearchResult : function(lat, lon) {
                //creates an position description similar to the result of a Nominatim search
                var diff = 0.005;
                var result = [];
                result[0] = {};
                result[0]["boundingbox"] = [parseFloat(lat)-diff,parseFloat(lat)+diff,parseFloat(lon)-diff,parseFloat(lon)+diff];
                result[0]["class"]="boundary";
                result[0]["display_name"]="Position: "+lat+" "+lon;
                result[0]["lat"] = lat;
                result[0]["lon"] = lon;
                return result;
            },
            _isLatLon : function (q) {
                //"lon lat" => xx.xxx x.xxxxx
                var re = /(-?\d+\.\d+)\s(-?\d+\.\d+)/;
                var m = re.exec(q);
                if (m != undefined) return m;

                //lat...xx.xxx...lon...x.xxxxx
                re = /lat\D*(-?\d+\.\d+)\D*lon\D*(-?\d+\.\d+)/;
                m = re.exec(q);
                //showRegExpResult(m);
                if (m != undefined) return m;
                else return null;
            },
            _isLatLon_decMin : function (q) {
                console.log("is LatLon?: "+q);
                //N 53° 13.785' E 010° 23.887'
                //re = /[NS]\s*(\d+)\D*(\d+\.\d+).?\s*[EW]\s*(\d+)\D*(\d+\.\d+)\D*/;
                re = /([ns])\s*(\d+)\D*(\d+\.\d+).?\s*([ew])\s*(\d+)\D*(\d+\.\d+)/i;
                m = re.exec(q.toLowerCase());
                //showRegExpResult(m);
                if ((m != undefined)) return m;
                else return null;
                // +- dec min +- dec min
            },

            _geocode : function (event) {
                L.DomEvent.preventDefault(event);
                var q = this._input.value;
                //try to find corrdinates
                if (this._isLatLon(q) != null)
                {
                    var m = this._isLatLon(q);
                    console.log("LatLon: "+m[1]+" "+m[2]);
                    //m = {lon, lat}
                    this.options.callback.call(this, this._createSearchResult(m[1],m[2]));
                    return;
                }
                else if (this._isLatLon_decMin(q) != null)
                {
                    var m = this._isLatLon_decMin(q);
                    //m: [ns, lat dec, lat min, ew, lon dec, lon min]
                    var temp  = new Array();
                    temp['n'] = 1;
                    temp['s'] = -1;
                    temp['e'] = 1;
                    temp['w'] = -1;
                    this.options.callback.call(this,this._createSearchResult(
                        temp[m[1]]*(Number(m[2]) + m[3]/60),
                        temp[m[4]]*(Number(m[5]) + m[6]/60)
                    ));
                    return;
                }

                //and now Nominatim
                //http://wiki.openstreetmap.org/wiki/Nominatim
                console.log(this._callbackId);
                window[("_l_osmgeocoder_"+this._callbackId)] = L.Util.bind(this.options.callback, this);


                /* Set up params to send to Nominatim */
                var params = {
                    // Defaults
                    q: this._input.value,
                    json_callback : ("_l_osmgeocoder_"+this._callbackId++),
                    format: 'json'
                };

                if (this.options.bounds && this.options.bounds != null) {
                    if( this.options.bounds instanceof L.LatLngBounds ) {
                        params.viewbox = this.options.bounds.toBBoxString();
                        params.bounded = 1;
                    }
                    else {
                        console.log('bounds must be of type L.LatLngBounds');
                        return;
                    }
                }

                if (this.options.email && this.options.email != null) {
                    if (typeof this.options.email == 'string') {
                        params.email = this.options.email;
                    }
                    else{
                        console.log('email must be a string');
                    }
                }

                var protocol = location.protocol;
                if (protocol == "file:") protocol = "https:";
                var url = protocol + "//nominatim.openstreetmap.org/search" + L.Util.getParamString(params),
                    script = document.createElement("script");




                script.type = "text/javascript";
                script.src = url;
                script.id = this._callbackId;
                document.getElementsByTagName("head")[0].appendChild(script);
            },

            _expand: function () {
                L.DomUtil.addClass(this._container, 'leaflet-control-geocoder-expanded');
            },

            _collapse: function () {
                this._container.className = this._container.className.replace(' leaflet-control-geocoder-expanded', '');
            }
        });

    </script>
    <script>
        // <script src="javascripts/leaflet.rotatedMarker.js">
        (function() {
            // save these original methods before they are overwritten
            var proto_initIcon = L.Marker.prototype._initIcon;
            var proto_setPos = L.Marker.prototype._setPos;

            var oldIE = (L.DomUtil.TRANSFORM === 'msTransform');

            L.Marker.addInitHook(function () {
                var iconOptions = this.options.icon && this.options.icon.options;
                var iconAnchor = iconOptions && this.options.icon.options.iconAnchor;
                if (iconAnchor) {
                    iconAnchor = (iconAnchor[0] + 'px ' + iconAnchor[1] + 'px');
                }
                this.options.rotationOrigin = this.options.rotationOrigin || iconAnchor || 'center bottom' ;
                this.options.rotationAngle = this.options.rotationAngle || 0;

                // Ensure marker keeps rotated during dragging
                this.on('drag', function(e) { e.target._applyRotation(); });
            });

            L.Marker.include({
                _initIcon: function() {
                    proto_initIcon.call(this);
                },

                _setPos: function (pos) {
                    proto_setPos.call(this, pos);
                    this._applyRotation();
                },

                _applyRotation: function () {
                    if(this.options.rotationAngle) {
                        this._icon.style[L.DomUtil.TRANSFORM+'Origin'] = this.options.rotationOrigin;

                        if(oldIE) {
                            // for IE 9, use the 2D rotation
                            this._icon.style[L.DomUtil.TRANSFORM] = 'rotate(' + this.options.rotationAngle + 'deg)';
                        } else {
                            // for modern browsers, prefer the 3D accelerated version
                            this._icon.style[L.DomUtil.TRANSFORM] += ' rotateZ(' + this.options.rotationAngle + 'deg)';
                        }
                    }
                },

                setRotationAngle: function(angle) {
                    this.options.rotationAngle = angle;
                    this.update();
                    return this;
                },

                setRotationOrigin: function(origin) {
                    this.options.rotationOrigin = origin;
                    this.update();
                    return this;
                }
            });
        })();

    </script>

        function getTheData() {
            drawTheMap(getTheJSONdataFromThePage())
            // fetch('/apiProxy').then((resp) => resp.json()) // Transform the data into json
            // .then((data) => {
            //     drawTheMap(data)
            // })
        }

        function drawTheMap(myData) {

            // var myData = !{JSON.stringify(jsonData)};

            // Create variable to hold map element, give initial settings to map
            var map = L.map('map', {center: [43.64701, -79.39425], zoom: 3});

            // Add OpenStreetMap tile layer to map element
            L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/World_Street_Map/MapServer/tile/{z}/{y}/{x}', {
                attribution: 'Tiles &copy; Esri &mdash; Source: Esri, DeLorme, NAVTEQ, USGS, Intermap, iPC, NRCAN, Esri Japan, METI, Esri China (Hong Kong), Esri (Thailand), TomTom, 2012'
            }).addTo(map);


            // PlaneIcon
            var planeIcon = L.icon({
                iconUrl :'https://www.shareicon.net/data/128x128/2015/08/12/84186_plane_512x512.png',
            iconSize: [15, 15]

            });

            // Add JSON to map

            L.geoJson(myData, {

                onEachFeature: iris,

                pointToLayer: function (feature, latlng) {
                    return L.marker(latlng, {icon: planeIcon, rotationAngle: feature.properties.f3})
                }

            }).bindPopup(function (layer) {
                return featurePropertiesToPopUpContent(layer.feature.properties);
            }).addTo(map);

            function iris (feature,layer){
                

                layer.setIcon(planeIcon);
            };

            //Search bar for location

            var osmGeocoder = new L.Control.OSMGeocoder({
                collapsed: false,
                position: 'topright',
                text: 'Locate'
            });
            map.addControl(osmGeocoder);

        }

        function featurePropertiesToPopUpContent(data) {
            return `
                <span>icao24 = ${data.icao24}</span>
                <br>
                <span>callsign = ${data.callsign}</span>
                <br>
                <span>origin_country = ${data.origin_country}</span>
                <br>
                <span>time_position = ${data.time_position}</span>
                <br>
                <span>last_contact = ${data.last_contact}</span>
                <br>
                <span>longitude = ${data.longitude}</span>
                <br>
                <span>latitude = ${data.latitude}</span>
                <br>
                <span>baro_altitude = ${data.baro_altitude}</span>
                <br>
                <span>on_ground = ${data.on_ground}</span>
                <br>
                <span>velocity = ${data.velocity}</span>
                <br>
                <span>true_track = ${data.true_track}</span>
                <br>
                <span>vertical_rate = ${data.vertical_rate}</span>
                <br>
                <span>sensors = ${data.sensors}</span>
                <br>
                <span>geo_altitude = ${data.geo_altitude}</span>
                <br>
                <span>squawk = ${data.squawk}</span>
                <br>
                <span>spi = ${data.spi}</span>
                <br>
                <span>position_source = ${data.position_source}</span>
                <br>
            `
        }
    </script>
